import React, { useState } from "react";

const AddOwnerForm = () => {
  const [message, setMessage] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    formData.append("OwnerSalutation", e.target.OwnerSalutation.value);
    formData.append("OwnerFirstName", e.target.OwnerFirstName.value);
    formData.append("OwnerLastName", e.target.OwnerLastName.value);
    formData.append("OwnerNationality", e.target.OwnerNationality.value);
    formData.append("OwnerAddress1", e.target.OwnerAddress1.value);
    formData.append("OwnerAddress2", e.target.OwnerAddress2.value);
    formData.append("OwnerCity", e.target.OwnerCity.value);
    formData.append("OwnerState", e.target.OwnerState.value);
    formData.append("OwnerCountry", e.target.OwnerCountry.value);
    formData.append("OwnerZipCode", e.target.OwnerZipCode.value);
    formData.append("OwnerMobileNumber", e.target.OwnerMobileNumber.value);
    formData.append("OwnerEmailId", e.target.OwnerEmailId.value);
    formData.append("OwnerPassportNumber", e.target.OwnerPassportNumber.value);
    formData.append("OwnerDateOfBirth", e.target.OwnerDateOfBirth.value);
    formData.append("OwnerVisaExpiryDate", e.target.OwnerVisaExpiryDate.value);
    formData.append("OwnerPassportExpiryDate", e.target.OwnerPassportExpiryDate.value);
    formData.append("CreatedBy", e.target.CreatedBy.value);
    formData.append("ApprovedBy", e.target.ApprovedBy.value);

    // Append files
    formData.append("OwnerEID", e.target.OwnerEID.files[0]);
    formData.append("OwnerPassportCopy", e.target.OwnerPassportCopy.files[0]);
    formData.append("OwnerResVisa", e.target.OwnerResVisa.files[0]);

    try {
      const response = await fetch("http://localhost:5000/add_owner", {
        method: "POST",
        body: formData,
        credentials: "include", // send cookies/session
      });

      const data = await response.json();
      if (data.success) {
        setMessage(`✅ ${data.message}`);
        e.target.reset(); // Clear the form
      } else {
        setMessage(`❌ ${data.message}`);
      }
    } catch (err) {
      setMessage(`❌ Network error: ${err.message}`);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input name="OwnerSalutation" placeholder="Salutation" required />
      <input name="OwnerFirstName" placeholder="First Name" required />
      <input name="OwnerLastName" placeholder="Last Name" required />
      <input name="OwnerNationality" placeholder="Nationality" required />
      <input name="OwnerAddress1" placeholder="Address 1" required />
      <input name="OwnerAddress2" placeholder="Address 2" />
      <input name="OwnerCity" placeholder="City" required />
      <input name="OwnerState" placeholder="State" required />
      <input name="OwnerCountry" placeholder="Country" required />
      <input name="OwnerZipCode" placeholder="Zip Code" required />
      <input name="OwnerMobileNumber" placeholder="Mobile Number" required />
      <input name="OwnerEmailId" placeholder="Email" required />
      <input name="OwnerPassportNumber" placeholder="Passport Number" required />
      <input type="date" name="OwnerDateOfBirth" placeholder="Date of Birth" required />
      <input type="date" name="OwnerVisaExpiryDate" placeholder="Visa Expiry" required />
      <input type="date" name="OwnerPassportExpiryDate" placeholder="Passport Expiry" required />
      <input name="CreatedBy" placeholder="Created By" />
      <input name="ApprovedBy" placeholder="Approved By" />

      <label>EID Image:</label>
      <input type="file" name="OwnerEID" required />
      <label>Passport Copy:</label>
      <input type="file" name="OwnerPassportCopy" required />
      <label>Residence Visa:</label>
      <input type="file" name="OwnerResVisa" required />

      <button type="submit">Add Owner</button>

      {message && <p>{message}</p>}
    </form>
  );
};

export default AddOwnerForm;
